    false,nt"url": null,nt"notes": "NCEI Accession 0117056 includes Surface
    underway data collected from Ryofu Maru in the East China Sea (Tung Hai), North
    Pacific Ocean, Philippine Sea and South Pacific Ocean from 2010-04-15 to 2013-09-13.
    These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity) of carbon
    dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide - water,
    SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these data
    include Carbon dioxide (CO2) gas analyzer, Shower head chamber equilibrator for
    autonomous carbon dioxide (CO2) measurement, not applicable and thermosalinographs.nnThese
    data were collected by Shu Saito and Akira Nakadate of Japan Meteorological Agency;
    Pollutants Chemical Analysis Center; Marine Division; Global Environment and Marine
    Department as part of the VOS_Ryofu_Maru_2010_2013 data set. CDIAC associated the
    following cruise ID(s) with this data set: 49UP20100415nnThe Global Volunteer Observing
    Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
    Project (IOCCP). International groups from 14 countries have been outfitting research
    ships and commercial vessels with automated CO2 sampling equipment to analyze the
    carbon exchange between the ocean and atmosphere.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
